import styled from "styled-components";
import { useState } from "react";

const AddFriend = () => {
  const [searchWord, setSearchWord] = useState();
  return (
    <>
      <input
        type="text"
        name="searchWord"
        onChange={(event) => setSearchWord(event.target.value)}
      />
    </>
  );
};

export default AddFriend;
